  input: '"TEXT","F3A",,"Regarding your letter dated May 28, 2003, the contributions
    listed therein were in fact reported on 48-hour notices.  The contribution from
    Ted Boersma was reported as a receipt from Boersma A and T Dairy on 10/23/02;
    the contribution from Blake Curtis was reported as a contribution from B&T Farms
    on 10/23/02; the contribution from Susan Hance was reported on 10/28/02 as a contribution
    from Susan Hance; the contribution from Debbie Idsinga was reported as a contribution
    from Crosswinds Dairy on 10/23/02; the contribution from Cyle Sharp was reported
    as a contribution from CR Land and Cattle on 10/23/02; and the contribution from
    Deborah Pryce was in fact a contribution from her leadership PAC, Promoting Republicans
    You Can Elect Project, which was reported on 10/31/02.  This last contribution
    somehow got entered incorrectly when the data was converted from the old system
    to the new system.  As for the other four contributions, except the one from Susan
    Hance, those four had been entered as the name appeared on the check, i,e.,  the
    name of the partnerships - and so those were the names that appeared on the 48
    hour notices.  The individuals'' names were also reported on the Committee''s
    post-general report, however, it was not clear as to which partnership check was
    attributed to which individual contributor.  Again, we apologize for the confusion
    but the Committee is confident that its new software will take care of many of
    the reporting glitches it experienced in its first election cycle.  "'
